import axios from "axios";
import {
  VISUALIZZA_NOTIFICHE,
  INVIA_NOTIFICA_CLIENTE,
  CANCELLA_NOTIFICA,
} from "./type";

export const ListaNotifiche = (cliente) => (dispatch) => {
  axios
    .put("/api/notifiche/notifichelist/", cliente)
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: VISUALIZZA_NOTIFICHE,
        payload: res.data,
      });
    })
    .catch((err) => console.error(err));
};

export const inviaNotificaCliente = (idnotifica, cliente) => (dispatch) => {
  axios
    .put(`/api/notifiche/notificheprenotazionicliente/`, cliente)
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: INVIA_NOTIFICA_CLIENTE,
        payload: idnotifica,
      });
    })
    .catch((err) => console.error(err));
};

export const cancellaNotifica = (idnotifica) => (dispatch) => {
  axios
    .delete(`/api/notifiche/cancellanotifica/${idnotifica}`)
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: CANCELLA_NOTIFICA,
        payload: idnotifica,
      });
    })
    .catch((err) => console.error(err));
};
